Watch as I transform into...uh something? Last week, a group of Artists challenged each other to get creative. We each sent an inspirational photo to a partner and had a few days to come up with something.
🎨🎨🎨
@jesshaisingermu challenged me to create a look inspired by one of @sarahdelaneyart’s paintings. This is the result! I read that Sarah chooses to add depth to her paintings without using black - so I did the same. Check out my previous post for a look at everyone’s work! 🎨🎨🎨
